var transformMatrixLeft = [1, 0, 0, 1, 0, 0];
var transformMatrixRight = [1, 0, 0, 1, 0, 0];
var svg = document.getElementById('svg5');

var imgLeft = svg.getElementById("imgLeft");
var frameLeft = svg.getElementById("frameLeft");
var frameLeftX = parseFloat(frameLeft.getAttributeNS(null, "x"));
var frameLeftY = parseFloat(frameLeft.getAttributeNS(null, "y"));
var frameLeftWidth = parseFloat(frameLeft.getAttributeNS(null, "width"));
var frameLeftHeight = parseFloat(frameLeft.getAttributeNS(null, "height"));
var centerXLeft = frameLeftX + (frameLeftWidth / 2);
var centerYLeft = frameLeftY + (frameLeftHeight / 2);

var imgRight = svg.getElementById("imgRight");
var frameRight = svg.getElementById("frameRight");
var frameRightX = parseFloat(frameRight.getAttributeNS(null, "x"));
var frameRightY = parseFloat(frameRight.getAttributeNS(null, "y"));
var frameRightWidth = parseFloat(frameRight.getAttributeNS(null, "width"));
var frameRightHeight = parseFloat(frameRight.getAttributeNS(null, "height"));
var centerXRight = frameRightX + (frameRightWidth / 2);
var centerYRight = frameRightY + (frameRightHeight / 2);

function pan(dx, dy) {
	transformMatrix[4] += dx;
	transformMatrix[5] += dy;

	var newMatrix = "matrix(" +  transformMatrix.join(' ') + ")";
	imgLeft.setAttributeNS(null, "transform", newMatrix);
}

function zoom(scale) {
  for (var i = 0; i < 4; i++) {
    transformMatrixLeft[i] *= scale;
    transformMatrixRight[i] *= scale;
  }

  transformMatrixLeft[4] = (1 - transformMatrixLeft[0]) * centerXLeft;
  transformMatrixLeft[5] = (1 - transformMatrixLeft[3]) * centerYLeft;

  transformMatrixRight[4] = (1 - transformMatrixRight[0]) * centerXRight;
  transformMatrixRight[5] = (1 - transformMatrixRight[3]) * centerYRight;

  var newMatrix = "matrix(" +  transformMatrixLeft.join(' ') + ")";
  imgLeft.setAttributeNS(null, "transform", newMatrix);

  newMatrix = "matrix(" +  transformMatrixRight.join(' ') + ")";
  imgRight.setAttributeNS(null, "transform", newMatrix);
}
